import React from 'react';
import { Link } from 'react-router-dom';

function Home(props) {
  return (
    <div>
      <h1>Bank of React</h1>
      <Link to="/credits">Credits</Link> | <Link to="/debits">Debits</Link>
      <div>Balance: ${props.accountBalance.toFixed(2)}</div>
    </div>
  );
}

export default Home;
